import Grid from '@mui/material/Grid';
import { Container, createTheme, ThemeProvider, GlobalStyles } from '@mui/material';
import Posts from './components/Posts';

const theme = createTheme({
  palette: {
    primary: {
      main: '#010440',
    },
    secondary: {
      main: '#D90D32'
    }
  }
})


const App = () => {
	return (
    <ThemeProvider theme={theme}>
      <GlobalStyles
          styles={{
            body: { backgroundColor: '#F2EADF'},
          }}
        />
		<div className="container">
      <Grid
        container
        direction="row"
        justifyContent="center"
        alignItems="flex-start"
      >
        <h1>N2 - Programação Web</h1><br/>
      </Grid>
        <Container sx={{ width: '75%' }}>
        <Posts />
      </Container>
		</div>
    </ThemeProvider>
	)
}

export default App
